"use strict";

const largestValsFromLabels = (values, labels, numWanted, useLimit) => {
    const arr = values.map((val, i) => [val, labels[i]]);
    arr.sort((a, b) => b[0] - a[0]);
    const cnt = {};
    let ans = 0;
    let num = 0;
    for (const [v, l] of arr) {
        cnt[l] = (cnt[l] || 0) + 1;
        if (cnt[l] <= useLimit) {
            num++;
            ans += v;
        }
        if (num === numWanted) {
            break;
        }
    }
    return ans;
};
